/**
 * Allow detecting authenticated routes with pattern parameters
 * @example
 * routes = [
  * {
      path: "/users/:id",
      component: () => <></>,
      authenticatedRoute: true
    }
]
 */
export declare const getIsAuthRoute: <T extends {
    authenticatedRoute: boolean;
    path: string;
}>(routes: Array<T>, pathname: string) => boolean;
